import React from 'react';
import { Box, Link, Typography, useTheme } from '@mui/material';
import axios from "axios";
import toast from "react-hot-toast";
import { useNavigate } from "react-router-dom";
import { NavLink } from "react-router-dom";



const Navbar = () => {
  const theme = useTheme();
  const navigate = useNavigate();
  const loggedIn = JSON.parse(localStorage.getItem("authToken"));
//handle logout
  const handleLogout = async () => {
    try {
      await axios.post("/api/v1/auth/logout");
      localStorage.removeItem("authToken");
      toast.success("logout successfully ");
      navigate("/login");
    } catch (error) {
      console.log(error);
      }
    };
  return (
    <Box
      width="100%"
      backgroundColor={theme.palette.background.alt}
      p="1rem 6%"
      display="flex"
      alignItems="center"
      justifyContent="space-between"
      textAlign="center"
      sx={{ boxShadow: 3, mb: 2 }}
      minHeight="64px"
    >
      
      <Box sx={{ margin: '0 auto' }}>
        <Link href="/" underline='none'>
        {/*<img src="/client/logo.png" alt="Logo" height={40} />*/}
        <Typography variant="h1" color="primary" fontWeight="bold" style={{ fontFamily: 'Space Grotesk' }}>
          MyGPT
        </Typography>
        </Link>
      </Box>

    {
      loggedIn ? (
        <>
    <Link href="/" p={1}> 
      <Typography
        component='span' variant='body1' color='primary' fontWeight='bold' p={1} sx={{ border: '2px solid', borderRadius: '30px', padding: '8px 16px', marginRight: '10px' }}>
          Home
      </Typography>
    </Link>
    
    <Link href="/login" onClick={handleLogout}underline='none'> 
      <Typography
        component='span' variant='body1' color='primary' fontWeight='bold' p={1} sx={{ border: '2px solid', borderRadius: '30px', padding: '8px 16px', marginRight: '10px' }}>
          Log
      </Typography>
    </Link> 
    </> ) : (
    <>
    <Box sx={{ display: 'flex', gap: '5px' }}>

      <Link href="/login" underline='none'> 
        <Typography
          component='span' variant='body1' color='primary' fontWeight='bold' p={1} sx={{ border: '2px solid', borderRadius: '30px', padding: '8px 16px', marginRight: '10px' }}>
            Login
        </Typography>
      </Link>
      <Link href="/register" underline='none'> 
        <Typography
          component='span' variant='body1' color='primary' fontWeight='bold' p={1} sx={{ border: '2px solid', borderRadius: '30px', padding: '8px 16px', marginRight: '0px' }}>
            Sign Up
        </Typography>
      </Link>
    </Box>
    </>
    )}
      
    </Box>
  );
};

export default Navbar;
